import React from "react";
import "./intro.css";
import bg from ".././assetss/sourav.png"

export function Intro() {
  return (
    <div>
      <section id="intro">
        <div className="introcontent"></div>
        <img src={bg} alt="ng" className="bg" />
      </section>
    </div>
  );
}
